  const [cards, setcards] = useState([])
  const cartItems = useSelector(state => state.carts)
  console.log(cartItems, "CARTTTTTTT");
  setcards(cartItems)

  return (
    <Provider store={store}>
      <ProductComponant />
      <Cart cards={cards}/>
    </Provider>
  )
}

export default RoutLayout
